import React from "react";
import img4 from "./images/lemichs.avif"

function Owners() {
  return (
    <div>
      <div className="row mt-5">
        <div className="col-lg-4"></div>
        <div className="col-lg-4">
            <img src={img4} className="w-100" />
        </div>
        <div className="col-lg-4"></div>
      </div>
      <div className="row">
        <div className="col-lg-4"></div>
        <div className="col-lg-4"></div>
        <div className="col-lg-4"></div>
      </div>
    </div>
  );
}

export default Owners;
